import React, { Component } from 'react'
import { lighten, makeStyles, withStyles } from '@material-ui/core/styles';

import {CardHeader, Card, IconButton, CardContent} from '@material-ui/core';
import Ratings from '@material-ui/lab/Rating';
import LinearProgress from '@material-ui/core/LinearProgress';

import MoreVertIcon from '@material-ui/icons/MoreVert';

import './Ratings.scss'

class Rating extends Component {
    constructor(props) {
        super(props)

        this.state = {
             value: 4,
        }
    }


    render() {
        return (
            <Card raised={true} className='card-cont'>
                <CardHeader
                    action={
                        <div>
                            <IconButton onClick = {()=> {}}><MoreVertIcon /></IconButton>
                        </div>
                    }
                    title="Ratings and Reviews"
                    titleTypographyProps={{variant:'h6' }}
                    />
                <CardContent>
                    <Ratings name="read-only" value={this.state.value} readOnly />
                    <span className="rating_count">124 Total Ratings</span>
                    <div className="ratings_container">
                        <div className="ratings">
                            <h2>4.5</h2>
                            <p>Average Ratings</p>
                        </div>
                        <div className="progreebar_container">
                        <LinearProgress
                            variant="determinate"
                            color="secondary"
                            value={60}
                        />
                        <LinearProgress
                            variant="determinate"
                            color="secondary"
                            value={50}
                        />
                        <LinearProgress
                            variant="determinate"
                            color="secondary"
                            value={40}
                        />
                        <LinearProgress
                            variant="determinate"
                            color="secondary"
                            value={30}
                        />
                        <LinearProgress
                            variant="determinate"
                            color="secondary"
                            value={20}
                        />
                        </div>
                    </div>
                </CardContent>
            </Card>
        )
    }
}

export default Rating
